import React from "react";
import { useState } from 'react'
import {useEffect} from "react"
import axios from "axios";
import "./App.css";

function App() {
  const [coins, setCoins] = useState([]);

  useEffect(() => {
    axios.get(
      "https://api.coingecko.com/api/v3/coins/markets?vs_currency=sgd&order=market_cap_desc&per_page=100&page=1&sparkline=false&price_change_percentage=7d%2C30d%2C200d%2C1y"
    )
    .then(res => {
      setCoins(res.data)
    })

  });

  return (
    <div className="App">
      <p>Hello world, how are you doing today?</p>
      <button>Press me</button>
      <footer>Please press me.</footer>
    </div>
  );
}

export default App;
